import classes from './Headerthingys.module.css';

const Itemsearchbar = () => {
    return (
        <div>
            <form>
                <input list="items" id="item-names" placeholder='Find Mobile Phones, Books and more...'/>
                <datalist id="items" >
                    <option value="mobiles">Mobiles</option>
                    <option value="Laptops">Laptops</option>
                    <option value="Cycles">Cycles</option>
                    <option value="Mattresses">Mattresses</option>
                </datalist>
                <button><img src="https://thumbs.dreamstime.com/b/search-icon-vector-found-find-concept-magnifying-glass-sign-isolated-black-background-search-icon-vector-found-find-concept-132462908.jpg" width={30} height={30} /></button>
            </form>
        </div>
    );
}
 
export default Itemsearchbar;
